// CAStore allows uploading / caching content-addressable files.
type CAStore struct {
config CAStoreConfig
*uploadStore
*cacheStore
cleanup *cleanupManager
}

// Manager defines interface for a persisted retry manager.
type Manager interface {
Add(Task) error
SyncExec(Task) error
Close()
Find(query interface{}) ([]Task, error)
}

// Generator wraps static piece length configuration in order to determinstically
// generate metainfo.
type Generator struct {
pieceLengthConfig *pieceLengthConfig
cas *store.CAStore
}

// Event consolidates all possible event fields.
type Event struct {
Name Name `json:"event"`
Torrent string `json:"torrent"`
Self string `json:"self"`
Time time.Time `json:"ts"`
// Optional fields.
Peer string `json:"peer,omitempty"`
Piece int `json:"piece,omitempty"`
Bitfield []bool `json:"bitfield,omitempty"`
DurationMS int64 `json:"duration_ms,omitempty"`
ConnCapacity int `json:"conn_capacity,omitempty"`
}

// Scheduler defines operations for scheduler.
type Scheduler interface {
Stop()
Download(namespace string, d core.Digest) error
BlacklistSnapshot() ([]connstate.BlacklistedConn, error)
RemoveTorrent(d core.Digest) error
Probe() error
}

// List defines a list of addresses which is subject to change.
type List interface {
Resolve() stringset.Set
}
